import { Card, Grid } from "@mui/material";
import SoftBox from "components/SoftBox";
import SoftTypography from "components/SoftTypography";
import MasterCard from "examples/Cards/MasterCard";
import React from "react";
import Header from "layouts/profile/components/Header";
import curved0 from "assets/images/curved-images/curved0.jpg";
import OutlinedCounterCard from "examples/Cards/CounterCards/OutlinedCounterCard";
import Invoice from "layouts/billing/components/Invoice";

const Results = () => {
  return (
    <SoftBox py={3}>
      <Grid container spacing={5} m>
        <Grid item xs={12} md={6} lg={7}>
          <SoftBox
            color="white"
            bgColor="dark"
            variant="gradient"
            borderRadius="lg"
            shadow="lg"
            opacity={1}
          >
            <SoftTypography variant="h3" align="center" padding={2} color="white">
              Tu mejor opciÃ³n es comprar de Contado ðŸ’°
            </SoftTypography>
          </SoftBox>
        </Grid>
        <Grid item xs={12} xl={5}>
          <OutlinedCounterCard
            count={23980}
            prefix="$"
            title="Sumatoria de las cuotas ajustadas a valor de hoy"
            pad={0.8}
            color="dark"
            cap={false}
          />
        </Grid>
      </Grid>
      <Grid container spacing={5}>
        <Grid item xs={12} md={6} lg={7}>
          <Card sx={{ height: "100%" }}>
            <SoftBox
              pt={2}
              px={2}
              display="flex"
              justifyContent="space-between"
              alignItems="center"
            >
              <SoftTypography variant="h6" fontWeight="medium">
                Invoices
              </SoftTypography>
              {/* <SoftButton variant="outlined" color="info" size="small">
                view all
              </SoftButton> */}
            </SoftBox>
            <SoftBox p={2}>
              <SoftBox component="ul" display="flex" flexDirection="column" p={0} m={0}>
                <Invoice date="March, 01, 2020" id="#MS-415646" price="$180" />
                <Invoice date="February, 10, 2021" id="#RV-126749" price="$250" />
                <Invoice date="April, 05, 2020" id="#QW-103578" price="$120" />
                <Invoice date="June, 25, 2019" id="#MS-415646" price="$180" />
                <Invoice date="March, 01, 2019" id="#AR-803481" price="$300" noGutter />
              </SoftBox>
            </SoftBox>
          </Card>
        </Grid>
      </Grid>
    </SoftBox>
  );
};

export default Results;
